import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Header from './components/Header';
// import Footer from './components/Footer';

const App: React.FC = () => {
  return (
    <Router>
    <Header />
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
    </Router>
  );
};

export default App;
